/**
 * @brief Initiates a ReadData class.
 *
 * @date 2013-03-31
 */
ReadData::ReadData() :
	loop_hairpin(30 + 1, N_INFINITY),
	loop_bulge(30 + 1, N_INFINITY),
	loop_interior(30 + 1, N_INFINITY)
{
	this->load_int11();
	this->load_int21();
	this->load_int22();
	
	this->load_stack();
	this->load_tstackh();
	this->load_tstacki();
	
	this->load_loop_hairpin();
	this->load_loop_interior();
	this->load_loop_bulge();
	this->load_triloop();
	this->load_tloop();
	
	this->load_miscloop();
	this->load_poppen();
}



